<!DOCTYPE html>
<html lang="en">
<head>

    <!-- Leaflet CSS -->
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/leaflet.min.css" />
    
    <!-- MarkerCluster CSS -->
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.5.3/MarkerCluster.css" />
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.5.3/MarkerCluster.Default.css" />
    
    <!-- Leaflet and MarkerCluster JS -->
    <script src="https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/leaflet.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/leaflet.markercluster/1.5.3/leaflet.markercluster.js"></script>
    
    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: Arial, sans-serif;
        }
        
        .container {
            display: flex;
            height: 100vh;
        }
        
        #map {
            flex: 1;
            height: 100%;
        }
        
        .sidebar {
            width: 300px;
            padding: 20px;
            background-color: #f8f8f8;
            overflow-y: auto;
        }
        
        h1 {
            font-size: 1.5rem;
            margin-top: 0;
        }
        
        .form-group {
            margin-bottom: 15px;
        }
        
        label {
            display: block;
            margin-bottom: 5px;
            font-weight: bold;
        }
        
        select, input {
            width: 100%;
            padding: 8px;
            border: 1px solid #ddd;
            border-radius: 4px;
        }
        
        button {
            padding: 10px 15px;
            background-color: #4CAF50;
            color: white;
            border: none;
            border-radius: 4px;
            cursor: pointer;
            font-size: 14px;
            margin-top: 10px;
        }
        
        button:hover {
            background-color: #45a049;
        }
        
        .legend {
            background: white;
            padding: 10px;
            border-radius: 5px;
            box-shadow: 0 0 15px rgba(0,0,0,0.2);
            line-height: 1.5;
        }
        
        .legend-circle {
            display: inline-block;
            border-radius: 50%;
            margin-right: 5px;
            border: 1px solid #555;
        }
        
        .status {
            margin-top: 20px;
            color: #0066cc;
        }
        
        /* Custom cluster styles */
        .custom-cluster {
            background-clip: padding-box;
            border-radius: 50%;
            text-align: center;
            font-weight: bold;
            font-family: Arial, sans-serif;
            display: flex;
            align-items: center;
            justify-content: center;
            color: white;
            text-shadow: 0 0 2px rgba(0,0,0,0.5);
        }
        
        /* Data table styles */
        .data-table-container {
            margin-top: 20px;
            max-height: 200px;
            overflow-y: auto;
            border: 1px solid #ddd;
            border-radius: 4px;
        }
        
        table {
            width: 100%;
            border-collapse: collapse;
        }
        
        th, td {
            padding: 8px;
            text-align: left;
            border-bottom: 1px solid #ddd;
            font-size: 12px;
        }
        
        th {
            background-color: #f2f2f2;
            position: sticky;
            top: 0;
        }
        
        .hidden {
            display: none;
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="sidebar">
            <h1>Household Map with Embedded Data</h1>
            
            <div class="form-group">
                <label for="color-select">Bubble Color:</label>
                <select id="color-select">
                    <option value="#3388ff">Blue</option>
                    <option value="#ff3333">Red</option>
                    <option value="#33ff33">Green</option>
                    <option value="#ff33ff">Purple</option>
                    <option value="#ff8833">Orange</option>
                </select>
            </div>
            
            <div class="form-group">
                <label for="max-radius">Maximum Bubble Size (px):</label>
                <input type="number" id="max-radius" value="30" min="5" max="100">
            </div>
            
            <button id="generate-map">Display Map</button>
            
            <div id="status" class="status"></div>
            
            <div class="form-group">
                <button id="toggle-data">Show/Hide Data Table</button>
            </div>
            
            <div id="data-table-container" class="data-table-container hidden">
                <table id="data-table">
                    <thead>
                        <tr>
                            <!-- Table headers will be dynamically inserted -->
                        </tr>
                    </thead>
                    <tbody>
                        <!-- Table rows will be dynamically inserted -->
                    </tbody>
                </table>
            </div>
        </div>
        
        <div id="map"></div>
    </div>

        ];
        
        // Column definitions - replace with your actual column names
        const latColumn = "ycoord";       // Your latitude column name
        const lngColumn = "xcoord";      // Your longitude column name
        const valueColumn = "VIVIENDAS";    // Your household count column name
        const labelColumn = "CVEGEO";     // Your label column name (optional)
        
        // =====================================================
        // MAP FUNCTIONALITY
        // =====================================================
        
        // Initialize the map
        const map = L.map('map').setView([20, 0], 2);
        
        // Add the tile layer (OpenStreetMap)
        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        }).addTo(map);
        
        // Initialize variables
        let markers;
        let legend = null;
        
        // DOM elements
        const colorSelect = document.getElementById('color-select');
        const maxRadiusInput = document.getElementById('max-radius');
        const generateBtn = document.getElementById('generate-map');
        const statusDiv = document.getElementById('status');
        const toggleDataBtn = document.getElementById('toggle-data');
        const dataTableContainer = document.getElementById('data-table-container');
        const dataTable = document.getElementById('data-table');
        
        // Define a custom cluster icon creator function
        function createCustomClusterIcon(cluster) {
            // Get the sum of household values in this cluster
            let totalHouseholds = 0;
            const markers = cluster.getAllChildMarkers();
            
            markers.forEach(marker => {
                totalHouseholds += marker.householdValue || 0;
            });
            
            // Scale the size based on the total value
            const radius = Math.min(60, Math.max(20, Math.sqrt(totalHouseholds) / 2));
            
            // Get the color from the select element
            const color = document.getElementById('color-select').value;
            
            // Create the HTML for the icon
            const iconHtml = `
                <div class="custom-cluster" style="
                    width: ${radius * 2}px; 
                    height: ${radius * 2}px; 
                    background-color: ${color};
                    font-size: ${Math.max(10, radius / 2)}px;
                    box-shadow: 0 0 0 4px rgba(0,0,0,0.2);
                ">
                    ${totalHouseholds.toLocaleString()}
                </div>
            `;
            
            return L.divIcon({
                html: iconHtml,
                className: '',
                iconSize: L.point(radius * 2, radius * 2)
            });
        }
        
        // Create a marker cluster group with custom functionality
        function createMarkerClusterGroup() {
            return L.markerClusterGroup({
                showCoverageOnHover: false,
                zoomToBoundsOnClick: true,
                spiderfyOnMaxZoom: true,
                removeOutsideVisibleBounds: true,
                iconCreateFunction: createCustomClusterIcon
            });
        }
        
        // Initialize marker cluster group
        markers = createMarkerClusterGroup();
        map.addLayer(markers);
        
        // Generate the map with embedded data
        function generateMap() {
            const color = colorSelect.value;
            const maxRadius = parseInt(maxRadiusInput.value) || 30;
            
            statusDiv.textContent = 'Generating map...';
            
            try {
                // Clear existing markers
                map.removeLayer(markers);
                markers = createMarkerClusterGroup();
                
                // Find min and max values for scaling
                let minValue = Number.MAX_VALUE;
                let maxValue = Number.MIN_VALUE;
                let totalHouseholds = 0;
                
                embeddedData.forEach(row => {
                    const value = parseFloat(row[valueColumn]);
                    if (!isNaN(value) && value > 0) {
                        minValue = Math.min(minValue, value);
                        maxValue = Math.max(maxValue, value);
                        totalHouseholds += value;
                    }
                });
                
                // Function to calculate radius based on value
                const getRadius = (value) => {
                    if (isNaN(value) || value <= 0) return 5;
                    return 5 + ((value - minValue) / (maxValue - minValue)) * (maxRadius - 5);
                };
                
                // Add markers to the map
                let validPoints = 0;
                let invalidPoints = 0;
                
                embeddedData.forEach(row => {
                    const lat = parseFloat(row[latColumn]);
                    const lng = parseFloat(row[lngColumn]);
                    const value = parseFloat(row[valueColumn]);
                    const label = labelColumn ? row[labelColumn] : '';
                    
                    if (!isNaN(lat) && !isNaN(lng) && !isNaN(value) && 
                        lat >= -90 && lat <= 90 && lng >= -180 && lng <= 180) {
                        
                        const radius = getRadius(value);
                        const marker = L.circleMarker([lat, lng], {
                            radius: radius,
                            fillColor: color,
                            color: '#000',
                            weight: 1,
                            opacity: 1,
                            fillOpacity: 0.7
                        });
                        
                        // Store the household value in the marker for clustering
                        marker.householdValue = value;
                        
                        let popupContent = `<b>${labelColumn ? (label || 'N/A') : 'Location'}</b><br>`;
                        popupContent += `Latitude: ${lat.toFixed(6)}<br>`;
                        popupContent += `Longitude: ${lng.toFixed(6)}<br>`;
                        popupContent += `${valueColumn}: ${value.toLocaleString()}`;
                        
                        marker.bindPopup(popupContent);
                        markers.addLayer(marker);
                        validPoints++;
                    } else {
                        invalidPoints++;
                    }
                });
                
                // Add markers to map
                map.addLayer(markers);
                
                // Fit bounds if we have points
                if (validPoints > 0) {
                    map.fitBounds(markers.getBounds(), { padding: [50, 50] });
                }
                
                // Update status
                statusDiv.textContent = `Generated map with ${validPoints.toLocaleString()} locations containing ${Math.round(totalHouseholds).toLocaleString()} total households. ${invalidPoints > 0 ? `(${invalidPoints} invalid points were skipped)` : ''}`;
                
                // Add legend
                addLegend(minValue, maxValue, maxRadius, color);
                
                // Create data table
                populateDataTable();
                
            } catch (error) {
                statusDiv.textContent = 'Error generating map: ' + error.message;
            }
        }
        
        // Add legend to map
        function addLegend(minValue, maxValue, maxRadius, color) {
            // Remove existing legend if any
            if (legend) {
                map.removeControl(legend);
            }
            
            legend = L.control({ position: 'bottomright' });
            
            legend.onAdd = function() {
                const div = L.DomUtil.create('div', 'legend');
                div.innerHTML = `<h4>${valueColumn}</h4>`;
                
                // Calculate legend values
                const values = [
                    minValue,
                    minValue + (maxValue - minValue) * 0.25,
                    minValue + (maxValue - minValue) * 0.5,
                    minValue + (maxValue - minValue) * 0.75,
                    maxValue
                ];
                
                // Create legend circles
                values.forEach(value => {
                    const radius = 5 + ((value - minValue) / (maxValue - minValue)) * (maxRadius - 5);
                    div.innerHTML += `
                        <div>
                            <span class="legend-circle" style="width: ${radius * 2}px; height: ${radius * 2}px; background-color: ${color};"></span>
                            ${Math.round(value).toLocaleString()}
                        </div>
                    `;
                });
                
                return div;
            };
            
            legend.addTo(map);
        }
        
        // Populate data table
        function populateDataTable() {
            // Clear existing table
            const thead = dataTable.querySelector('thead tr');
            const tbody = dataTable.querySelector('tbody');
            thead.innerHTML = '';
            tbody.innerHTML = '';
            
            // Create header row if data exists
            if (embeddedData.length > 0) {
                // Get all column names from first row
                const columns = Object.keys(embeddedData[0]);
                
                // Add headers
                columns.forEach(column => {
                    const th = document.createElement('th');
                    th.textContent = column;
                    thead.appendChild(th);
                });
                
                // Add data rows
                embeddedData.forEach(row => {
                    const tr = document.createElement('tr');
                    
                    columns.forEach(column => {
                        const td = document.createElement('td');
                        td.textContent = row[column];
                        tr.appendChild(td);
                    });
                    
                    tbody.appendChild(tr);
                });
            }
        }
        
        // Toggle data table visibility
        toggleDataBtn.addEventListener('click', function() {
            dataTableContainer.classList.toggle('hidden');
            if (!dataTableContainer.classList.contains('hidden') && dataTable.querySelector('tbody').innerHTML === '') {
                populateDataTable();
            }
        });
        
        // Generate map button click handler
        generateBtn.addEventListener('click', generateMap);
        
        // Color select change handler
        colorSelect.addEventListener('change', function() {
            generateMap();
        });
        
        // Generate map on page load
        window.onload = function() {
            generateMap();
        };
    </script>
